import React from 'react';
import './Home.css'; // Importa os estilos para o componente Home
import startImage from '../images/pngwing.com.png'
const Home = () => {
  return (
    <div className="home-container">
      <h1>Tecido Osseo</h1>
      <img
        src={startImage}
        alt="Imagem Iniciar"
        onClick={() => console.log('Iniciar clicado')}
      />
      <p>Iniciar</p>
    </div>
  );
};

export default Home;
